ControlPropertyState.AutoRuleBindingString:
If(
    Not(
        Or(
            EndsWith(
                Lower(Last(Self.Attachments).Name),
                ".xlsx"
            )
        )
    ),
    Notify(
        "Only Excel files are allowed",
        NotificationType.Error
    );
    Reset(Self)
)

